	  p103.appendChild(document.createTextNode("As "));
	  p103.appendChild(a104);
	  p103.appendChild(document.createTextNode(" advanced, it became more difficult to compare the performance of various computer systems simply by looking at their specifications. Therefore, tests were developed that allowed comparison of different architectures. For example, "));
	  p103.appendChild(a105);
	  p103.appendChild(document.createTextNode(" processors generally operate at a higher clock frequency than "));
	  p103.appendChild(a106);
	  p103.appendChild(document.createTextNode(" processors, which does not necessarily translate to more computational power. A slower processor, with regard to clock frequency, may perform as well as a processor operating at a higher frequency. See "));
