	  a110.setAttribute("title", "Hard disk")
	  p109.appendChild(document.createTextNode("Benchmarks are designed to mimic a particular type of workload on a component or system. Synthetic benchmarks do this by specially created programs that impose the workload on the component. Application benchmarks run real-world programs on the system. While application benchmarks usually give a much better measure of real-world performance on a given system, synthetic benchmarks are useful for testing individual components, like a "));
	  p109.appendChild(a110);
	  p109.appendChild(document.createTextNode(" or networking device."));
	  a112.appendChild(document.createTextNode("CPU design"));
	  a112.setAttribute("href", "/wiki/CPU_design")
	  a112.setAttribute("class", "mw-redirect")
	  a112.setAttribute("title", "CPU design")
	  a113.appendChild(document.createTextNode("microarchitectural"));
