	  a114.setAttribute("class", "mw-redirect")
	  a114.setAttribute("title", "Algorithms")
	  p111.appendChild(document.createTextNode("Benchmarks are particularly important in "));
	  p111.appendChild(a112);
	  p111.appendChild(document.createTextNode(", giving processor architects the ability to measure and make tradeoffs in "));
	  p111.appendChild(a113);
	  p111.appendChild(document.createTextNode(" decisions. For example, if a benchmark extracts the key "));
	  p111.appendChild(a114);
	  p111.appendChild(document.createTextNode(" of an application, it will contain the performance-sensitive aspects of that application. Running this much smaller snippet on a cycle-accurate simulator can give clues on how to improve performance."));
