	  p115.appendChild(a116);
	  p115.appendChild(document.createTextNode(" to do this, although SPEC's Unix-based benchmarks were quite lengthy and thus unwieldy to use intact."));
	  a118.appendChild(document.createTextNode("RISC"));
	  a118.setAttribute("href", "/wiki/RISC")
