	  a121.appendChild(document.createTextNode("compiler"));
	  a121.setAttribute("href", "/wiki/Compiler")
	  a121.setAttribute("title", "Compiler")
	  p117.appendChild(document.createTextNode("Computer manufacturers are known to configure their systems to give unrealistically high performance on benchmark tests that are not replicated in real usage. For instance, during the 1980s some compilers could detect a specific mathematical operation used in a well-known floating-point benchmark and replace the operation with a faster mathematically equivalent operation. However, such a transformation was rarely useful outside the benchmark until the mid-1990s, when "));
	  p117.appendChild(a118);
	  p117.appendChild(document.createTextNode(" and "));
	  p117.appendChild(a119);
	  p117.appendChild(document.createTextNode(" architectures emphasized the importance of "));
	  p117.appendChild(a120);
	  p117.appendChild(document.createTextNode(" technology as it related to performance. Benchmarks are now regularly used by "));
	  p117.appendChild(a121);
	  p117.appendChild(document.createTextNode(" companies to improve not only their own benchmark scores, but real application performance."));
	  a123.appendChild(document.createTextNode("superscalar"));
	  a123.setAttribute("href", "/wiki/Superscalar")
	  a123.setAttribute("class", "mw-redirect")
	  a123.setAttribute("title", "Superscalar")
	  a124.appendChild(document.createTextNode("VLIW"));
	  a124.setAttribute("href", "/wiki/VLIW")
	  a124.setAttribute("class", "mw-redirect")
	  a124.setAttribute("title", "VLIW")
	  a125.appendChild(document.createTextNode("reconfigurable computing"));
	  a125.setAttribute("href", "/wiki/Reconfigurable_computing")
	  a125.setAttribute("title", "Reconfigurable computing")
	  p122.appendChild(document.createTextNode("CPUs that have many execution units — such as a "));
	  p122.appendChild(a123);
	  p122.appendChild(document.createTextNode(" CPU, a "));
	  p122.appendChild(a124);
	  p122.appendChild(document.createTextNode(" CPU, or a "));
	  p122.appendChild(a125);
	  p122.appendChild(document.createTextNode(" CPU — typically have slower clock rates than a sequential CPU with one or two execution units when built from transistors that are just as fast. Nevertheless, CPUs with many execution units often complete real-world and benchmark tasks in less time than the supposedly faster high-clock-rate CPU."));
	  p126.appendChild(document.createTextNode("Given the large number of benchmarks available, a manufacturer can usually find at least one benchmark that shows its system will outperform another system; the other systems can be shown to excel with a different benchmark."));
	  i128.appendChild(document.createTextNode("bench-marketing."));
	  p127.appendChild(document.createTextNode("Manufacturers commonly report only those benchmarks (or aspects of benchmarks) that show their products in the best light. They also have been known to mis-represent the significance of benchmarks, again to show their products in the best possible light. Taken together, these practices are called "));
	  p127.appendChild(i128);
	  p129.appendChild(document.createTextNode("Ideally benchmarks should only substitute for real applications if the application is unavailable, or too difficult or costly to port to a specific processor or computer system. If performance is critical, the only benchmark that matters is the target environment's application suite."));
	  span131.appendChild(document.createTextNode("Challenges"));
	  span131.setAttribute("class", "mw-headline")
	  span131.id = "Challenges"
	  h2130.appendChild(span131);
	  p132.appendChild(document.createTextNode("Benchmarking is not easy and often involves several iterative rounds in order to arrive at predictable, useful conclusions. Interpretation of benchmarking data is also extraordinarily difficult. Here is a partial list of common challenges:"));
	  li134.appendChild(document.createTextNode("Vendors tend to tune their products specifically for industry-standard benchmarks. Norton SysInfo (SI) is particularly easy to tune for, since it mainly biased toward the speed of multiple operations. Use extreme caution in interpreting such results."));
	  a137.appendChild(document.createTextNode("[1]"));
	  a137.setAttribute("href", "#cite_note-1")
	  sup136.appendChild(a137);
	  sup136.id = "cite_ref-1"
	  sup136.setAttribute("class", "reference")
	  li135.appendChild(document.createTextNode("Some vendors have been accused of \"cheating\" at benchmarks — doing things that give much higher benchmark numbers, but make things worse on the actual likely workload."));
	  li135.appendChild(sup136);
	  a139.appendChild(document.createTextNode("computational performance"));
	  a139.setAttribute("href", "/wiki/Computer_performance")
	  a139.setAttribute("title", "Computer performance")
	  a142.appendChild(document.createTextNode("Transaction Processing Performance Council"));
	  a142.setAttribute("href", "/wiki/Transaction_Processing_Performance_Council")
	  a142.setAttribute("title", "Transaction Processing Performance Council")
	  a143.appendChild(document.createTextNode("ACID"));
	  a143.setAttribute("href", "/wiki/ACID")
	  a143.setAttribute("title", "ACID")
	  li141.appendChild(document.createTextNode("Qualities of service, aside from raw performance. Examples of unmeasured qualities of service include security, availability, reliability, execution integrity, serviceability, scalability (especially the ability to quickly and nondisruptively add or reallocate capacity), etc. There are often real trade-offs between and among these qualities of service, and all are important in business computing. "));
	  li141.appendChild(a142);
	  li141.appendChild(document.createTextNode(" Benchmark specifications partially address these concerns by specifying "));
	  li141.appendChild(a143);
	  li141.appendChild(document.createTextNode(" property tests, database scalability rules, and service level requirements."));
	  a145.appendChild(document.createTextNode("Total cost of ownership"));
	  a145.setAttribute("href", "/wiki/Total_cost_of_ownership")
	  a145.setAttribute("title", "Total cost of ownership")
	  a146.appendChild(document.createTextNode("TCO"));
	  a146.setAttribute("href", "/wiki/Total_cost_of_ownership")
	  a146.setAttribute("title", "Total cost of ownership")
	  li144.appendChild(document.createTextNode("In general, benchmarks do not measure "));
	  li144.appendChild(a145);
	  li144.appendChild(document.createTextNode(". Transaction Processing Performance Council Benchmark specifications partially address this concern by specifying that a price/performance metric must be reported in addition to a raw performance metric, using a simplified "));
	  li144.appendChild(a146);
	  li144.appendChild(document.createTextNode(" formula. However, the costs are necessarily only partial, and vendors have been known to price specifically (and only) for the benchmark, designing a highly specific \"benchmark special\" configuration with an artificially low price. Even a tiny deviation from the benchmark package results in a much higher price in real world experience."));
	  a148.appendChild(document.createTextNode("performance per watt"));
	  a148.setAttribute("href", "/wiki/Performance_per_watt")
	  a148.setAttribute("title", "Performance per watt")
	  li147.appendChild(document.createTextNode("Facilities burden (space, power, and cooling). When more power is used, a portable system will have a shorter battery life and require recharging more often. A server that consumes more power and/or space may not be able to fit within existing data center resource constraints, including cooling limitations. There are real trade-offs as most semiconductors require more power to switch faster. See also "));
	  li147.appendChild(a148);
	  li147.appendChild(document.createTextNode("."));
	  a150.appendChild(document.createTextNode("code density"));
	  a150.setAttribute("href", "/wiki/Code_density")
	  a150.setAttribute("class", "mw-redirect")
	  a150.setAttribute("title", "Code density")
	  li149.appendChild(document.createTextNode("In some embedded systems, where memory is a significant cost, better "));
	  li149.appendChild(a150);
	  li149.appendChild(document.createTextNode(" can significantly reduce costs."));
	  ul140.appendChild(li141);
	  ul140.appendChild(li144);
	  ul140.appendChild(li147);
	  ul140.appendChild(li149);
	  li138.appendChild(document.createTextNode("Many benchmarks focus entirely on the speed of "));
	  li138.appendChild(a139);
	  li138.appendChild(document.createTextNode(", neglecting other important features of a computer system, such as: "));
	  li138.appendChild(ul140);
	  a152.appendChild(document.createTextNode("disaster recovery"));
	  a152.setAttribute("href", "/wiki/Disaster_recovery")
	  a152.setAttribute("title", "Disaster recovery")
	  li151.appendChild(document.createTextNode("Vendor benchmarks tend to ignore requirements for development, test, and "));
	  li151.appendChild(a152);
	  li151.appendChild(document.createTextNode(" computing capacity. Vendors only like to report what might be narrowly required for production capacity in order to make their initial acquisition price seem as low as possible."));
	  a154.appendChild(document.createTextNode("grid computing"));
	  a154.setAttribute("href", "/wiki/Grid_computing")
	  a154.setAttribute("title", "Grid computing")
	  li153.appendChild(document.createTextNode("Benchmarks are having trouble adapting to widely distributed servers, particularly those with extra sensitivity to network topologies. The emergence of "));
	  li153.appendChild(a154);
	  li153.appendChild(document.createTextNode(", in particular, complicates benchmarking since some workloads are \"grid friendly\", while others are not."));
	  a156.appendChild(document.createTextNode("service level agreements"));
	  a156.setAttribute("href", "/wiki/Service_level_agreement")
	  a156.setAttribute("class", "mw-redirect")
	  a156.setAttribute("title", "Service level agreement")
	  a157.appendChild(document.createTextNode("real-time computing"));
	  a157.setAttribute("href", "/wiki/Real-time_computing")
	  a157.setAttribute("title", "Real-time computing")
	  li155.appendChild(document.createTextNode("Users can have very different perceptions of performance than benchmarks may suggest. In particular, users appreciate predictability — servers that always meet or exceed "));
	  li155.appendChild(a156);
	  li155.appendChild(document.createTextNode(". Benchmarks tend to emphasize mean scores (IT perspective), rather than maximum worst-case response times ("));
	  li155.appendChild(a157);
	  li155.appendChild(document.createTextNode(" perspective), or low standard deviations (user perspective)."));
	  li158.appendChild(document.createTextNode("Many server architectures degrade dramatically at high (near 100%) levels of usage — \"fall off a cliff\" — and benchmarks should (but often do not) take that factor into account. Vendors, in particular, tend to publish server benchmarks at continuous at about 80% usage — an unrealistic situation — and do not document what happens to the overall system when demand spikes beyond that level."));
	  a160.appendChild(document.createTextNode("virtualization"));
	  a160.setAttribute("href", "/wiki/Hardware_virtualization")
	  a160.setAttribute("title", "Hardware virtualization")
	  li159.appendChild(document.createTextNode("Many benchmarks focus on one application, or even one application tier, to the exclusion of other applications. Most data centers are now implementing "));
	  li159.appendChild(a160);
	  li159.appendChild(document.createTextNode(" extensively for a variety of reasons, and benchmarking is still catching up to that reality where multiple applications and application tiers are concurrently running on consolidated servers."));
	  a162.appendChild(document.createTextNode("Batch computing"));
	  a162.setAttribute("href", "/wiki/Batch_computing")
	  a162.setAttribute("class", "mw-redirect")
	  a162.setAttribute("title", "Batch computing")
	  li161.appendChild(document.createTextNode("There are few (if any) high quality benchmarks that help measure the performance of batch computing, especially high volume concurrent batch and online computing. "));
	  li161.appendChild(a162);
	  li161.appendChild(document.createTextNode(" tends to be much more focused on the predictability of completing long-running tasks correctly before deadlines, such as end of month or end of fiscal year. Many important core business processes are batch-oriented and probably always will be, such as billing."));
	  a165.appendChild(document.createTextNode("[2]"));
	  a165.setAttribute("href", "#cite_note-2")
	  sup164.appendChild(a165);
	  sup164.id = "cite_ref-2"
